const routes = (app) => {
  //basic rotes
  app
    .route("/express")
    .get(
      (req, res, next) => {
        //midellware
        console.log(`Request form: ${req.originalUrl}`);
        console.log(`Request type: ${req.method}`);
        next();
      },
      (req, res) => {
        res.send("this is the get of my express route");
      }
    )
    .post((req, res) => {
      res.send("this is the post of  my express route");
    });

  //parameters routes
  app
    .route("/express/:dependencyId")
    .put((req, res) => {
      res.send(
        `this is the put of  my express route and the parameter is ${Number(
          req.params.dependencyId
        )}`
      );
    })
    .delete((req, res) => {
      res.send(
        `this is the delete of  my express route and the parameter is ${Number(
          req.params.dependencyId
        )}`
      );
    });
};

export default routes;

